use IRRIGACAO

-- Adicionando Campo Sequencia
ALTER TABLE [Classificação Fiscal]
ADD Seq Int

GO

-- Deletando os NCM que nunca usaram
DELETE FROM [Classificação Fiscal] WHERE NOT EXISTS(SELECT TOP 1 1 FROM Produtos WHERE [Classificação Fiscal].[Seqüência da Classificação] = Produtos.[Seqüência da Classificação]) AND NOT EXISTS(SELECT TOP 1 1 FROM Conjuntos WHERE [Classificação Fiscal].[Seqüência da Classificação] = Conjuntos.[Seqüência da Classificação]) AND NOT EXISTS(SELECT TOP 1 1 FROM [Nota Fiscal] WHERE [Classificação Fiscal].[Seqüência da Classificação] = [Nota Fiscal].[Seqüência da Classificação]) AND NOT EXISTS(SELECT TOP 1 1 FROM Orçamento WHERE [Classificação Fiscal].[Seqüência da Classificação] = Orçamento.[Seqüência da Classificação]) AND NOT EXISTS(SELECT TOP 1 1 FROM Pedido WHERE [Classificação Fiscal].[Seqüência da Classificação] = Pedido.[Seqüência da Classificação])

